import React from 'react';
//import MapToComponents from 'react-map-to-components' 
const Todo = (props) =>{
   const {items}=props;
   const listitems=items.map(item =>{
       return (
           <div key={item.id}>
               <span>{item.name}</span>
               <span>{item.age}</span>
               <span>&times;</span>
           </div>
       )
   })
  
    {
        return(
        <div>
            <span>Name</span>
            <span>Age</span>
            <span>{listitems}</span>
            
            
            </div>
        )
    }
}
export default Todo;
